	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 398px; min-height: 331px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 4px; top: 4px; width: 390px; min-height: 323px;\"><p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#9fc5f8; font-weight:normal; font-style:normal; text-decoration:normal;\">Enamel:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Hardest material in the body; protects dentin. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Composed of enamel prisms (calcified rods). </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#9fc5f8; font-weight:normal; font-style:normal; text-decoration:normal;\">Dentin:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Makes up most of the tooth structure. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Contains dentinal tubules that transmit pain stimuli to the pulp. </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#9fc5f8; font-weight:normal; font-style:normal; text-decoration:normal;\">Pulp:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Soft tissue inside the tooth; contains blood vessels and nerves. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Divided into coronal pulp (crown) and radicular pulp (root). </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#9fc5f8; font-weight:normal; font-style:normal; text-decoration:normal;\">Cementum:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Covers the root; joins enamel at the CEJ. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Protects the root and anchors periodontal fibers. </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.409;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-style:normal;top:-2px;font-family:\'Malgun Gothic\', sans-serif;\">​ </span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.409;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-style:normal;top:-2px;font-family:\'Malgun Gothic\', sans-serif;\">​ </span></p></div></div>",
